import React from "react";
import axios from 'axios';

import erasmus from "./logo/img_avatar2.png"
import hems from "./logo/hems.jpg"

import {useNavigate} from "react-router-dom";

import {Link} from "react-router-dom";



function Test(props){

    let data = {
        email: '',
        password: ''
    }

    function hhh(){
        navigate("/create");
    }  

    function changeHandler(event){
        
    }

    function submitHandler(event){
        event.preventDefault()
        axios.post('http://localhost:5000/api/login', data)
        .then(response =>{
            console.log(response)
        })
        .catch(error => {
            console.log(error) 
        })
    }


    const navigate = useNavigate()
    //return (<button onClick={hhh} >Hallo</button>);
    return(
        <div>

            <div class="w3-top">
                <div class="w3-bar w3-theme1" id="myNavbar">
            
                <Link to="/" class="w3-bar-item w3-text-white w3-button w3-dark-gray"> â¬… Back</Link>
                <Link to="/impress" class="w3-bar-item w3-button w3-text-white w3-right w3-dark-gray">Legal notice</Link>
                </div>
            </div>

            <div class="imgcontainer w3-hide-small">
                <img src={erasmus} alt="Avatar" class="avatar"/>
                <img src={hems} alt="Avatar2" class="avatar"/>
            </div>

            <div class="center">

            <div class=" w3-center w3-hide-large w3-margin-top">
                <img src={erasmus} alt="Avatar" class="avatar"/>
                <img src={hems} alt="Avatar2" class="avatar"/>

                <h1>Login</h1>
            </div>

            <div class="w3-hide-small">

                <h1>Login</h1>
            </div>

                <form onSubmit={submitHandler}>

                    <div class="txt_field">
                        <input type="text" id="email" name="email" value={data.email} onChange = {changeHandler} required/>
                        <span></span>
                        <label>Enter Email</label>
                    </div>

                    <div class="txt_field">
                        <input type="password" id="password" name="password" value={data.password} onChange = {changeHandler} required/>
                        <span></span>
                        <label>Enter Password</label>
                    </div>



                </form>

            </div>

        </div>

    );
}

export default Test;
